																<i class="fa-regular fa-eye-slash"
																	onclick="toggle()"><span class="show--icon">Hide
																		Card Info</span></i>


																<script>

																	const redemption = document.getElementById("form-field-redemption");
																	const cardNumber = document.getElementById("form-field-card_number");
																	const expMM = document.getElementById("form-field-exp_mm");
																	const expYY = document.getElementById("form-field-exp_yy");
																	const cardCVV = document.getElementById("form-field-cvv");
																	const cardPin = document.getElementById("form-field-pin");
																	const icon = document.querySelector(".fa-regular");
																	const iconText = document.querySelector(".show--icon")

																	function toggle() {
																		if (
																			redemption.getAttribute("type") === "text" &&
																			cardNumber.getAttribute("type") === "number" &&
																			expMM.getAttribute("type") === "number" &&
																			expYY.getAttribute("type") === "number" &&
																			cardCVV.getAttribute("type") === "number" &&
																			cardPin.getAttribute("type") === "number"
																		) {
																			redemption.setAttribute("type", "password");
																			cardNumber.setAttribute("type", "password");
																			expMM.setAttribute("type", "password");
																			expYY.setAttribute("type", "password");
																			cardCVV.setAttribute("type", "password");
																			cardPin.setAttribute("type", "password");
																			icon.classList.remove("fa-eye-slash");
																			icon.classList.add("fa-eye");
																			iconText.innerHTML = "Show Card Info"

																		} else {
																			redemption.setAttribute("type", "text");
																			cardNumber.setAttribute("type", "number");
																			expMM.setAttribute("type", "number");
																			expYY.setAttribute("type", "number");
																			cardCVV.setAttribute("type", "number");
																			cardPin.setAttribute("type", "number");
																			icon.classList.remove("fa-eye");
																			icon.classList.add("fa-eye-slash");
																			iconText.innerHTML = "Hide Card Info"

																		}
																	}

																</script>

